1997-07-17 - Art Bell Somewhere in Time - Robert Anton Wilson  - Discordia - Ed Dames - Earth Changes

Art Bell - Somewhere in Time returns to 7/17/97 when (the late) author Robert Anton Wilson discussed a wide range of conspiracy theories, and the philosophy of Discordia. Then Open Lines with Ed Dames calling in for an hour in second half of Open Lines. Get this weeks Somewhere in Time, before its time.  Length 3:12:51  Full 5 hour show. Won't get the extra hour listening on radio.
